import React, { useState,useEffect } from 'react'
import axios from 'axios';

import './App.css'

const url = 'https://3b33-2402-800-6235-73aa-987f-bbbf-be44-2572.ngrok-free.app//'
const TableBooking = () => {
const [bookings,setBookings] = useState([])
const [room_meeting, setRoomMeeting] = useState([])
const [employees, setEmployees] = useState([])

const fetchBooking = async () => {

    try {
        const response = await axios.get(url +'/bookings',
            {
                withCredentials: true
            }
        )
        setBookings(response.data.bookings);
    } catch (error) {
    }
}

useEffect(() => {
    fetchBooking()
}, []);
useEffect(() => {
    axios.get(url + '/employee',
    {
        withCredentials: true
    }
    ).then(res => {
        setEmployees(res.data.employee)})
})
  return (
    <div>
      <div className='container'>
        <table>
            <thead>
                <tr>
                    <th>STT</th>
                    <th>Room Name</th>
                    <th>Start Time</th>
                    <th>End Time</th>
                    <th>Employee</th>
                </tr>
            </thead>
            <tbody>
                {bookings.map((book, key )=>{
                    return(
                        <tr key={book.booking_id}>
                            <td>{book.booking_id}</td>
                            <td></td>

                        </tr>
                    )
                })}


            </tbody>
        </table>
      </div>
    </div>
  )
}

export default TableBooking
